  [],\n\t\"revision_timestamp\": \"2016-07-27T22:40:23.185085\",\n\t\"name\": \"lake-andes-national-wildlife-refuge-annual-narrative-report-calendar-year-1990\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lake Andes
  NWR, Lake Andes WMD, and Karl E. Mundt NWR outlines Refuge accomplishments during
  the 1990 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses compliance with environmental and cultural resource mandates
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, funding, safety, and technical assistance is given.
  Habitat management is also covered; subjects include wetlands, forests, croplands,
  grasslands, grazing, haying, fire management, pest control, water rights, and WPA
  easements. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, animal control, and disease control. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, and computer systems. Cooperative programs and items of interest are provided
  at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
